import './App.scss'

import RoutePaths from './routes/routes';
import { supabase } from './supabaseClient';

import { init } from 'supertokens-auth-react';

init({
  appInfo: {
    appName: 'My App',
    apiDomain: 'http://localhost:3000',
  },
  supabase,
});

function App() {
  return (

    <div className="App">
      <RoutePaths/>
      </div>
  );
}

export default App;
